// import Main from '../frontend/index.js';

// export default Main;

import { Provider } from 'react-redux';
import App from '../frontend/App';
import store from '../frontend/redux/store';

const Main = () => (
    <Provider store={store}>
        <App/>
    </Provider>
);

export default Main;
